import React from 'react';
import PropTypes from 'prop-types';

const Cell = (props) => {
  const {
    y,
    className,
    children,
    width
  } = props;

  return (
    <div key={y} className={className} style={{width: width + '%'}}>
      {children}
    </div>
  );
};

Cell.propTypes = {
  y: PropTypes.number.isRequired,
  children: PropTypes.oneOfType([
    PropTypes.number,
    PropTypes.string,
    PropTypes.element,
    PropTypes.arrayOf(PropTypes.element)
  ]).isRequired,
  className: PropTypes.string,
  width: PropTypes.number
};

export default Cell;
